const Wrapper = styled.div`
  display: flex;
  padding: 2.5rem;
`;
const ImgContainer = styled.div`
  flex: 1;
`;

const Image = styled.img`
  width: 100%;
  height: 90vh;
  object-fit: cover;
`;

const InfoContainer = styled.div`
  flex: 1;
  padding: 0 2rem;
`;

const Title = styled.h1``;

const Description = styled.p`
  font-weight: 100;
`;

const Price = styled.span``;

const Product = () => {
  return (
    <Container>
      <Annoucement />
      <Navbar />
      <Wrapper>
